const xlsx = require('xlsx');
const cache = require('./utilities/cache');

class XLReader {


    read_from_excel() {
        // Check if file data is cached if not then cache it
        if(!cache.get_cache('test_data')){
            cache.set_cache('test_data', xlsx.readFile('./testdata.xlsx'));
        }

        // Read data from cached file instead of xlsx file read function
        this.workbook = cache.get_cache('test_data');

        const list = this.workbook.SheetNames;

        for (let size = 0; size <= list.length; size++) {

            this.worksheet = this.workbook.Sheets[list[size]];
            this.workbook[size] = xlsx.utils.sheet_to_json(this.worksheet);

        }
        return this.workbook;
    }
}

module.exports = new XLReader();

